import React from 'react';


class InvetoryRow extends React.Component {
    
    constructor (props) {
        super (props);
        this.state = {
            columns : [
                {field: 'id', headerName : 'ID', width : 100},
                {field: 'name', headerName : 'Inventory Name', width : 300},
                {field: 'amount', headerName : 'Amount', width: 100},
            ],

            rows : [
                {id: 1, name : 'Helmet', bicycleModel: 'ATX68'},
                {id: 2, name : 'Wheel', bicycleModel: 'A6800', date: new Date (2021, 3, 5)},
                {id: 3, name : 'Thomas Davis', bicycleModel: 'BX9968', date: new Date (2021, 4, 8)},
            ] 
        }
    }

    render () {
        return (
            <div style={{ height: 400, width: '100%' }}>
                <DataGrid rows={this.state.rows} columns={this.state.columns} />
            </div>

        );
        
    }
}


class Inventory extends React.Component {
    
    render () {
        return (
            <h1>Current Inventory</h1>
        );
    }
}


export default Inventory
